          <div className="col-lg-5">
            <div className="mapDiv">
              <MapWithAMarkers
                listings={this.state.listings}
                setSelectedMarker={this.setSelectedMarker}
                selectedMarker={{ listingId: this.state.selectedMarker }}
              />
            </div>
          </div>
        </div>
      </div>
    );
  }
}
